	dictionary anchors_name = {{'smoke-1',AnchorData(0,0,0)},{'smoke-2',AnchorData(1,0,0)},{'gun-tip',AnchorData(2,1,0)},{'rockets',AnchorData(3,0,0)},{'pilot',AnchorData(4,1,0)},{'smoke-0',AnchorData(5,0,0)},{'foot-f-b',AnchorData(6,0,0)},{'foot-f-f',AnchorData(7,0,0)},{'foot-b-b',AnchorData(8,0,0)},{'foot-b-f',AnchorData(9,0,0)}};
